style.css:
@-moz-document url-prefix("https://www.google.com/search"), url-prefix("https://www.google.com/webhp") {
/* Cambiar la palabra "Google" en la esquina superior izquierda a negro con bordes blancos delgados */
  .lnXdpd, .k1zIA {
    filter: invert(1);
    -webkit-text-stroke: 1px white;
    color: black !important;
  }

  /* Ajustes adicionales para asegurarse de que el logo se mantenga con el mismo estilo en diferentes tama√±os */
  .lnXdpd, .k1zIA {
    -webkit-text-fill-color: black !important;
    text-shadow: -1px -1px 0 white, 1px -1px 0 white, -1px 1px 0 white, 1px 1px 0 white;
  }
}
